import React from 'react';
import { Box, Typography, AppBar, Toolbar, Container, CssBaseline, IconButton, InputBase, Grid,Card,CardMedia,CardContent, TextField,   Link,} from '@mui/material';
import { 
    AccountCircle as AccountCircleIcon, // Vị trí 6 (Profile)
    Search as SearchIcon, // Vị trí 8 (Search)
    LocationOn as LocationOnIcon, // Vị trí 7 (Location/City)
} from '@mui/icons-material';
import { Link as RouterLink } from 'react-router-dom';

// Import logo
import Logo from '../components/Logo'; 

// Dữ liệu mẫu cho các món ăn (Vị trí 10, 11, 12, 13)
const DUMMY_FOOD_ITEMS = [
    { id: 1, name: '料理名A', comments: 'Aさん', date: '30 August 2018' },
    { id: 2, name: '料理名B', comments: 'Bさん', date: '30 August 2018' },
    { id: 3, name: '料理名C', comments: 'Cさん', date: '30 August 2018' },
    // Thêm các món khác nếu cần
];
const Dashboard = () => {
    return (
        <CssBaseline>
            <Box
                sx={{
                    display: 'flex',
                    flexDirection: 'column',
                    minHeight: '100vh',
                    backgroundColor: '#f5f5f5',
                }}
            >
                {/* === Header (Vị trí 1, 2, 3, 4, 5, 6) === */}
                <AppBar position="static" color="default" elevation={1}>
                    <Toolbar sx={{ justifyContent: 'space-between' }}>
                        
                        {/* 1. LOGO (Trái) */}
                        <Box sx={{ display: 'flex', alignItems: 'center' }}>
                            <Logo size={40} />
                            
                            {/* 2, 3, 4, 5. Các nút điều hướng */}
                            <Box sx={{ display: { xs: 'none', md: 'flex' }, gap: 3 }}>
                                <Link component={RouterLink} to="/" color="inherit" underline="none" sx={{ fontWeight: 'bold' }}>ホーム</Link>
                                <Link component={RouterLink} to="/about" color="inherit" underline="none">紹介</Link>
                                <Link component={RouterLink} to="/map" color="inherit" underline="none">地図</Link>
                                <Link component={RouterLink} to="/contact" color="inherit" underline="none">連絡</Link>
                            </Box>
                        </Box>

                        {/* 6. Icon Profile (Phải) */}
                        <IconButton 
                            color="inherit" 
                            component={RouterLink} 
                            to="/profile" // Liên kết đến trang Profile
                        >
                            <AccountCircleIcon sx={{ fontSize: 30 }} />
                        </IconButton>
                    </Toolbar>
                </AppBar>

                {/* === Search Bar & Main Content (Vị trí 7, 8, 9) === */}
                <Container component="main" maxWidth="lg" sx={{ py: 4, flexGrow: 1 }}>

                    {/* Thanh Tìm kiếm (Vị trí 7, 8) */}
                    <Box sx={{ display: 'flex', mb: 4, gap: 2, alignItems: 'center' }}>
                        
                        {/* 7. Input Thành phố/Khu vực */}
                        <TextField
                            size="small"
                            label="都市名や地域を入力 (Tên thành phố/khu vực)"
                            defaultValue="Ha Noi"
                            InputProps={{
                                startAdornment: <LocationOnIcon sx={{ color: 'action.active', mr: 1 }} />,
                            }}
                            sx={{ flexShrink: 0, width: 200 }}
                        />

                        {/* 8. Input Tìm kiếm Món ăn/Nhà hàng */}
                        <Box sx={{ 
                            flexGrow: 1, 
                            display: 'flex', 
                            border: '1px solid #ccc', 
                            borderRadius: 1, 
                            p: 0.5, 
                            backgroundColor: 'white' 
                        }}>
                            <InputBase
                                placeholder="料理や店舗を検索する (Tìm kiếm món ăn/cửa hàng)"
                                sx={{ ml: 1, flex: 1 }}
                            />
                            <IconButton type="submit" sx={{ p: '10px' }} aria-label="search">
                                <SearchIcon />
                            </IconButton>
                        </Box>
                    </Box>

                    {/* Vị trí 9: Khu vực hiển thị Hình ảnh lớn/Banner */}
                    <Box sx={{ height: 250, backgroundColor: '#ccc', mb: 4, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                        <Typography variant="h4" color="text.secondary">画像 (Hình ảnh/Banner)</Typography>
                    </Box>

                    {/* Danh sách các món ăn (Vị trí 10, 11, 12, 13) */}
                    <Grid container spacing={4}>
                        {DUMMY_FOOD_ITEMS.map((item) => (
                            <Grid item key={item.id} xs={12} sm={6} md={4}>
                                <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
                                    {/* 10. Ảnh món ăn */}
                                    <CardMedia
                                        component="div"
                                        sx={{ pt: '56.25%' }} // Tỷ lệ 16:9
                                        image="https://via.placeholder.com/640x360" // Placeholder image
                                    />
                                    <CardContent sx={{ flexGrow: 1 }}>
                                        {/* 11. Tên món ăn */}
                                        <Typography gutterBottom variant="h6" component="h2" sx={{ fontWeight: 'bold' }}>
                                            {item.name}
                                        </Typography>
                                        
                                        {/* 12. Link xem chi tiết */}
                                        <Link component={RouterLink} to={`/details/${item.id}`} variant="body2" sx={{ color: 'primary.main', textDecoration: 'none' }}>
                                            もっと見る (Xem chi tiết)
                                        </Link>
                                        
                                        {/* 13. Khu vực comment/like/date */}
                                        <Box sx={{ mt: 2, borderTop: '1px solid #eee', pt: 1 }}>
                                            <Typography variant="body2" color="text.secondary">コメント (Comment)</Typography>
                                            <Typography variant="body2">{item.comments}さん</Typography>
                                            <Typography variant="caption" display="block" color="text.secondary">{item.date}</Typography>
                                            <Typography variant="caption" color="primary">Reply • Likes</Typography>
                                        </Box>
                                    </CardContent>
                                </Card>
                            </Grid>
                        ))}
                    </Grid>
                </Container>

                {/* === Footer (Vị trí 15) === */}
                <Box
                    component="footer"
                    sx={{
                        py: 3,
                        backgroundColor: (t) => t.palette.grey[100],
                        borderTop: (t) => `1px solid ${t.palette.divider}`,
                    }}
                >
                    <Container maxWidth="lg" sx={{ textAlign: 'center' }}>
                        {/* 15. Thông tin bản quyền */}
                        <Typography variant="body2" color="text.secondary">
                            フッター © {new Date().getFullYear()} Foody88. All rights reserved. | 著作権や情報リンク表示 (Bản quyền và thông tin liên kết)
                        </Typography>
                    </Container>
                </Box>
            </Box>
        </CssBaseline>
    );
};

export default Dashboard;
